 export const getProducts = ()=>{
  return new Promise((res, rej)=>{
    setTimeout(() => {
      res(products)   
    }, 2000)
  })
 }
 
 export const getProductByBrand = (brand) =>{
  return new Promise((res, rej)=>{
    setTimeout(()=>{
      res(products.filter(product => product.brand === brand))
    },2000)
  })
 }


 export const getProductById = (id) =>{
  return new Promise((res, rej) =>{
    setTimeout(()=>{
      res(products.find(product => product.id === id))
    }, 500)
  })
 } 
